import { Component } from '@angular/core';
import { CommunicationServiceService } from 'src/services/communication-service.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'angular-tour-of-heroes';

  constructor(public commService: CommunicationServiceService) {

  }

  toggleTime() {
    this.commService.toggleTime()
  }
}
<router-outlet></router-outlet>

<div class="col">
  <div class="col1"><app-analog-clock></app-analog-clock></div>
  <div class="col2"><app-digital-clock></app-digital-clock></div>
</div>

<div class="example-button-row">
  <button mat-raised-button color="primary" (click)="pauseTime()">Primary</button>
</div>
